import React from 'react'
import BoxInitial from './BoxInitial'
import BoxFinal from './BoxFinal'
import FileSubmitForm from './FileSubmitForm'
import axios from 'axios'

export default function Main() {

  const handleFileUpload = async (e) => {
    e.preventDefault();
    console.log(e);

    await fetch('/handleFile',{
      method: 'POST',
      file: e.target[0].files[0]
    })
    .then(res => res.json())
    .then(json=> console.log(json));

    await axios.post('/handleFile',{
      message: "Hello!"
    })
  }

  return (
    <div>
        <BoxInitial></BoxInitial>
        <BoxFinal></BoxFinal>
        <FileSubmitForm fileSubmitHandler={handleFileUpload}></FileSubmitForm>
    </div>
  )
}
